css:
/**
 * @format
 */
.nuclide-breadcrumb-bar {
  width: 100%;
  white-space: nowrap;
  height: 2.5em;
  display: flex;
  align-items: center;
}
.nuclide-breadcrumbs {
  display: inline-block;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.nuclide-breadcrumbs-navigation-stack-tile {
  padding: 0 2px;
  display: inline-block;
  height: 2.5em;
}
.nuclide-breadcrumbs-navigation-stack-tile .btn.nuclide-breadcrumbs-navigation-stack-button {
  cursor: default;
  font-size: 10px;
  height: 28px;
  width: 28px;
}
.nuclide-breadcrumbs-navigation-stack-tile .btn.nuclide-breadcrumbs-navigation-stack-button.left {
  margin-right: 0;
  transform: rotate(90deg);
}
.nuclide-breadcrumbs-navigation-stack-tile .btn.nuclide-breadcrumbs-navigation-stack-button.right {
  margin-left: 0;
  transform: rotate(-90deg);
}
.nuclide-breadcrumbs-navigation-stack-tile .btn.nuclide-breadcrumbs-navigation-stack-button:before {
  font-size: 26px;
  font-weight: 500;
}
.nuclide-breadcrumbs-navigation-stack-tile .btn.nuclide-breadcrumbs-navigation-stack-button[disabled] {
  border-color: #25282e;
  opacity: 0.3;
}
.nuclide-breadcrumbs-breadcrumb-list {
  margin: 0;
  padding: 0;
  display: flex;
  align-items: center;
  white-space: nowrap;
  position: absolute;
  top: 0;
}
.nuclide-breadcrumbs-outline-chevron {
  color: #484F5A;
}
.nuclide-breadcrumbs-outline-name.icon::before {
  vertical-align: top;
  line-height: inherit;
}
.nuclide-breadcrumbs-breadcrumb-list-item {
  list-style: none;
  margin: 0 5px;
  line-height: 2.5em;
  height: 2.5em;
  position: relative;
}
.nuclide-breadcrumbs-breadcrumb-list-item:hover {
  color: #ffffff;
}
.nuclide-breadcrumbs-breadcrumb-list-item:first-child {
  margin: 0 5px 0 0;
}
.nuclide-breadcrumbs-segment-wrapper {
  height: 2.5em;
  display: flex;
  align-items: center;
}
.nuclide-breadcrumbs-segment-wrapper atom-text-editor[mini] {
  position: relative;
  width: 100%;
}
.nuclide-breadcrumbs-segment-wrapper atom-text-editor[mini].is-focused {
  box-shadow: none;
  border-color: transparent;
}
.nuclide-breadcrumbs-segment-wrapper .nuclide-breadcrumbs-outline-name {
  display: inline-block;
}
.nuclide-breadcrumbs-segment-wrapper .nuclide-breadcrumbs-outline-name.icon {
  color: #484F5A;
}
.nuclide-breadcrumbs-segment-wrapper .nuclide-breadcrumbs-outline-name > div {
  display: inline-block;
}
.nuclide-breadcrumbs-segment-name {
  display: inline-block;
}
.nuclide-breadcrumbs-directory-dropdown {
  top: 2.5em;
  position: absolute;
  z-index: 3;
  border-left: 1px solid transparent;
  border-right: 1px solid transparent;
  border-bottom: 1px solid transparent;
  color: #7d868c;
  background-color: #25282e;
  overflow-y: auto;
}
.nuclide-breadcrumbs-directory-dropdown.loading {
  height: 1px;
  width: 100%;
  border: none;
  background-color: transparent;
}
.nuclide-breadcrumbs-directory-dropdown.loading::after {
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  content: '';
  display: block;
  height: 1px;
  background-image: linear-gradient(-45deg, transparent 33%, rgba(23, 202, 101, 0.3) 33%, rgba(23, 202, 101, 0.3) 66%, transparent 66%);
  background-size: 25px 8px, 100% 100%, 100% 100%;
  -webkit-animation: progress-buffering 3s linear 12, progress-buffering 3s 60s steps(10) 108;
  -webkit-mask-image: -webkit-linear-gradient(left, transparent, #17ca65, transparent);
}
.nuclide-breadcrumbs-directory-dropdown-list {
  padding: 0;
  display: block;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry {
  padding: 0px 10px;
  line-height: 2.5em;
  white-space: nowrap;
  margin: 0;
  cursor: default;
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry:hover {
  color: #ffffff;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry.selected {
  color: #ffffff;
  background-color: #343D46;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry :not(.parent-indicator) {
  flex-grow: 1;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry .parent-indicator {
  flex-grow: 0;
  margin-right: -10px;
  margin-left: 10px;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry .parent-indicator.icon-nuclicon-kebab-horizontal {
  margin-top: 2px;
}
.nuclide-breadcrumbs-directory-dropdown-list .nuclide-breadcrumbs-dropdown-entry .nuclide-breadcrumbs-outline-name {
  display: inline-block;
}
.nuclide-breadcrumbs-copy-icon {
  padding: 0 10px;
  z-index: 1;
  background: linear-gradient(to right, transparent 0%, #25282e 5px, #25282e 100%);
}
.nuclide-breadcrumbs-copy-icon:active {
  color: #ffffff;
}
